import React from 'react'
import './BasketPage.scss'
import {useParams} from 'react-router-dom'

const BasketPage = () => {

    const {id} = useParams();


    return (
        <div>
            <h1>Basket</h1>
            <p>{id}</p>
        </div>
    )
}

export default BasketPage
